import React from 'react';

const ImageGallery = ({ images }) => {
  if (images.length === 0) return null;

  return (
    <div className="image-gallery">
      <h3 className="image-gallery__title">Converted Images</h3>
      <div className="image-gallery__grid">
        {images.map((image, index) => (
          <div key={index} className="image-gallery__item">
            <img
              src={`/api/images/${image}`}
              alt={`Converted ${index + 1}`}
              className="image-gallery__image"
            />
            <div className="image-gallery__overlay">
              <button 
                onClick={() => window.open(`/api/images/${image}`, '_blank')}
                className="image-gallery__view-button"
              >
                View Full Size
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ImageGallery;
